fun minOperations(nums: List<Int>, target: Int): Int {
    val sortedNums = nums.sorted()
    var operations = 0
    var sum = sortedNums.sum()

    while (sum != target) {
        if (sum < target) {
            sortedNums.last()++
            operations++
        } else {
            sortedNums.first()--
            operations++
        }
        sum = sortedNums.sum()
    }

    return operations
}

